ge = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2085192","type":"CustomJS"},{"attributes":{"data":{},"selected":{"id":"2084972"},"selection_policy":{"id":"2084971"}},"id":"2084952","type":"ColumnDataSource"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"2085115"}],"tooltips":[["Date","@datetime{%c}"],["Volume","@Volume{0.00 a}"]]},"id":"2085117","type":"HoverTool"},{"attributes":{"coordinates":null,"data_source":{"id":"2085000"},"glyph":{"id":"2085001"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2085003"},"nonselection_glyph":{"id":"2085002"},"view":{"id":"2085005"}},"id":"2085004","type":"GlyphRenderer"},{"attributes":{},"id":"2085229","type":"AllLabels"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"
